import React from "react";

function Header() {
  return (
    <div className="header">
      <h3>LOGO</h3>
      <nav>
        <a href="#skills">Skills</a>
        <a href="#projects">Projects</a>
        <a href="#contact">Contact</a>
      </nav>
    </div>
  );
}

export default Header;
